{"source":{"uri":"features\/aboutThisSite.feature","data":"Feature:  \nAs an online shopper I want to know how the page was made.\n\nScenario: Look the technologies used in the site  \n    Given I am on the GMO OnLine main page\n    When I click the \"About The GMO Site\" button  \n    Then I should see a list of the following technologies: \n\n        | HTML 3.2 |\n        | HTML Browser Extensions |\n        | Animation |\n        | JavaScript |\n        | CGI |\n        | Java |\n        | ActiveX |\n        | Client-side processes |\n        | Server-side processes |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/accessPage.feature","data":"Feature: As an internet user\n    I want to use the GMO online page\n    so I can ensure that it works correctly\n\nScenario: Access the GMO OnLine homepage\n    Given I am on the Google homepage\n    When I paste the GMO OnLine URL in the address bar\n    Then I should see the welcome page\n\nScenario Outline: Verify navigation after pressing buttons on the GMO OnLine page\n    Given I am on the Google homepage\n    When I paste the GMO OnLine URL in the address bar\n    And I click the \"<button_title>\" button\n    Then I should see the \"<page_title>\" page\n\n    Examples:\n    | button_title         | page_title                        |   \n    | Enter GMO OnLine     | OnLine Catalog                    |   \n    | About The GMO Site   | About This Site                   |\n    | Browser Test Page    | All Browsers Are Not Created Equal| ","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/billingInformation.feature","data":"Feature: As an online shopper\n  I want to enter billing and shipping information\n  so I can complete my purchase\n\nBackground:\n  Given I am on the GMO OnLine main page\n  And I click the \"Enter GMO OnLine\" button\n  And I write \"1\" in the quantity of the product \"3 Person Dome Tent\"\n  And I click the \"Place An Order\" button\n  And I click the \"Proceed With Order\" button\n\nScenario Outline: Complete billing information by reusing the data for the shipment\n  When I fill in the billing information form\n    | Field             | Value              |\n    | Name              | Pepe               |\n    | Address           | casa redo          |\n    | City              | cocha              |\n    | State             | cercado            |\n    | Zip               | 33126              |\n    | Phone             | 123-123-1234       |\n    | E-mail            | redito@gmail.com   |\n  And I select \"<payment_method>\" from the \"Credit Card\" dropdown\n  And I fill in the payment information form\n    | Card Number       | <card_number>      |\n    | Expiration        | 05\/26              |\n  And I check the \"Same as Bill To\" checkbox\n  And I click the \"Place The Order\" button\n\n  Then I should see the \"OnLine Store Receipt\" page\n  \n  And I should see the following \"Bill To\" information\n    | Field             | Value                |\n    | Name              | Pepe                 |\n    | Address           | casa redo            |\n    | FullAdress        | cocha, cercado 33126 |\n\n  And I should see the following \"Ship To\" information\n    | Field             | Value                |\n    | Name              | Pepe                 |\n    | Address           | casa redo            |\n    | FullAdress        | cocha, cercado 33126 |\n    | Phone             | 123-123-1234         |\n\n  Examples:\n  | payment_method   | card_number          |\n  | American Express | 1234-123456-12345    |\n  | MasterCard       | 1234-1234-1234-1234  |\n  | Visa             | 1234-1234-1234-1234  |\n\n\nScenario: Complete billing information with different data for the shipment\n  When I fill in the billing information form\n    | Field             | Value              |\n    | Name              | Pepe               |\n    | Address           | casa redo          |\n    | City              | cocha              |\n    | State             | cercado            |\n    | Zip               | 33126              |\n    | Phone             | 123-123-1234       |\n    | E-mail            | redito@gmail.com   |\n  And I select \"Visa\" from the \"Credit Card\" dropdown\n  And I fill in the payment information form\n    | Card Number       | 1234-1234-1234-1234|\n    | Expiration        | 05\/26              |\n  And I fill in the shipping information form\n    | Field             | Value              |\n    | Name              | Denis              |\n    | Address           | casa boris         |\n    | City              | llallagua          |\n    | State             | bustillo           |\n    | Zip               | 27891              |\n    | Phone             | 321-321-4321       |\n  And I click the \"Place The Order\" button\n\n  Then I should see the \"OnLine Store Receipt\" page\n  \n  And I should see the following \"Bill To\" information\n    | Field             | Value                |\n    | Name              | Pepe                 |\n    | Address           | casa redo            |\n    | FullAdress        | cocha, cercado 33126 |\n\n  And I should see the following \"Ship To\" information\n    | Field             | Value                     |\n    | Name              | Denis                     |\n    | Address           | casa boris                |\n    | FullAdress        | llallagua, bustillo 27891 |\n    | Phone             | 321-321-4321              |\n\nScenario Outline: Complete billing information by omitting a bill field\n  When I fill in the billing information form\n    | Field             | Value              |\n    | Name              | <name_field>       |\n    | Address           | <address_field>    |\n    | City              | <city_field>       |\n    | State             | <state_field>      |\n    | Zip               | <zip_field>        |\n    | Phone             | <phone_field>      |\n    | E-mail            | <email_field>      |\n  And I select \"Visa\" from the \"Credit Card\" dropdown\n  And I fill in the payment information form\n    | Card Number       | 1234-1234-1234-1234|\n    | Expiration        | 05\/26              |\n  And I fill in the shipping information form\n    | Field             | Value              |\n    | Name              | Pepe               |\n    | Address           | casa redo          |\n    | City              | cocha              |\n    | State             | cercado            |\n    | Zip               | 33126              |\n    | Phone             | 123-123-1234       |\n  And I click the \"Place The Order\" button\n  And I see pop-up with the message \"<message>\"\n  And I click the \"OK\" button on the pop-up\n  And I fill in the \"<field_omitted>\" bill field with \"<value_field_omitted>\"\n  And I click the \"Place The Order\" button\n\n  Then I should see the \"OnLine Store Receipt\" page\n  \n  And I should see the following \"Bill To\" information\n    | Field             | Value                |\n    | Name              | Pepe                 |\n    | Address           | casa redo            |\n    | FullAdress        | cocha, cercado 33126 |\n\n  And I should see the following \"Ship To\" information\n    | Field             | Value                |\n    | Name              | Pepe                 |\n    | Address           | casa redo            |\n    | FullAdress        | cocha, cercado 33126 |\n    | Phone             | 123-123-1234         |\n\n  Examples:\n  | name_field    | address_field   | city_field    | state_field   | zip_field   | phone_field   | email_field       | field_omitted   | value_field_omitted   | message                                         | \n  |               | casa redo       | cocha         | cercado       | 33126       | 123-123-1234  | redito@gmail.com  | Name            | Pepe                  | This is a required field.                       |\n  | Pepe          |                 | cocha         | cercado       | 33126       | 123-123-1234  | redito@gmail.com  | Address         | casa redo             | This is a required field.                       |\n  | Pepe          | casa redo       |               | cercado       | 33126       | 123-123-1234  | redito@gmail.com  | City            | cocha                 | This is a required field.                       |\n  | Pepe          | casa redo       | cocha         |               | 33126       | 123-123-1234  | redito@gmail.com  | State           | cercado               | This is a required field.                       |\n  | Pepe          | casa redo       | cocha         | cercado       |             | 123-123-1234  | redito@gmail.com  | Zip             | 33126                 | Please enter a valid zip code in this field.    |\n  | Pepe          | casa redo       | cocha         | cercado       | 33126       |               | redito@gmail.com  | Phone           | 123-123-1234          | Please enter a valid phone number in this field.|\n  | Pepe          | casa redo       | cocha         | cercado       | 33126       | 123-123-1234  |                   | E-mail          | redito@gmail.com      | Please enter a valid email in this field.       |                     \n\n\nScenario Outline: Complete billing information by omitting the card number payment field\n  When I fill in the billing information form\n    | Field             | Value              |\n    | Name              | Pepe               |\n    | Address           | casa redo          |\n    | City              | cocha              |\n    | State             | {"source":{"uri":"features\/browsersTestPage.feature","data":"Feature:  \nAs a thoughtful site visitor, I want to verify the links behind the images on the Browser Test page  \nto ensure the site operates as expected and handles errors gracefully.  \n\nScenario: Redirect to \"Green Mountain Outpost\" when clicking on the GMO image\n    Given I am on the GMO Browser Test page\n    When I click on the \"Green Mountain Output\" image\n    Then I should be redirected to the \"Green Mountain Outpost\" page\n\nScenario: Redirect to the \"Java Applet\" page when clicking on the Java animation image\n    Given I am on the GMO Browser Test page\n    When I click on the \"Java Applet\" image\n    Then I should be redirected to the \"Java Applet\" page\n\nScenario: Redirect to the \"ActiveX\" page when clicking on the ActiveX animation image\n    Given I am on the GMO Browser Test page\n    When I click on the \"ActiveX\" image\n    Then I should be redirected to the \"ActiveX\" page\n\nScenario: Verify the \"Left or Right\" button functionality\n  Given I am on the GMO Browser Test page\n  When I click on the \"Left or Right\" button\n  Then I should see the alert message \"This button AND the GMO image should be on the right edge of the page!\"\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/detailProduct.feature","data":"Feature: Testing GMO Post Product Navigation\n  As an internet user\n  I want to interact with the demo GMO Post website\n  So I can view and explore details of available products\n\nScenario: View the catalog with products\n  Given I am on the Google homepage\n  When I paste the GMO OnLine URL in the address bar\n  And I click the \"Enter GMO OnLine\" button\n  Then I should see the \"OnLine Catalog\" page\n  And I should see the catalog with a list of products, including product names, prices, and item number\n\nScenario Outline: View details of a selected product\n  Given I am on the Google homepage\n  When I paste the GMO OnLine URL in the address bar\n  And I click the \"Enter GMO OnLine\" button\n  And I click the \"<product_name>\" product\n  Then I should see the product name \"<product_name>\"\n  And I should see the product detail \"<product_detail>\" for \"<product_name>\"\n  And I should see the unit price \"<unit_price>\" for \"<product_name>\"\n  And I should see the product number \"<product_number>\" for \"<product_name>\"\n  And I should see the product description for \"<product_name>\"\n\n  Examples:\n    | product_name             | product_detail                                                                                                | unit_price | product_number |\n    | 3 Person Dome Tent       | Our best 3 person backpack dome tent                                                                            | $ 299.99   | 1000        |\n    | External Frame Backpack  | Our most popular external frame backpack                                                                        | $ 179.95   | 1001        |\n    | Glacier Sun Glasses      | Our best glacier sun glasses will protect you on your next expedition or when you hit the slopes.               | $ 67.99    | 1002        |\n    | Padded Socks             | Our favorite padded socks will make your next back country trek easier on your feet.                            | $ 19.99    | 1003        |\n    | Hiking Boots             | Climb any mountain with our PermaDry all leather hiking boots.                                                  | $ 109.90   | 1004        |\n    | Back Country Shorts      | Our quick drying shorts are a customer favorite. Perfect for a day of any outdoor activity or just lounging around the camp. | $ 24.95     | 1005       |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
